export default function Chats(){
    return(
        <div className='chats__container'>
      <h1>Chat Groups</h1>
      <Link to='/create-chat-group' className='chats__btn'>
        <Button type='submit' toOperation='create-chat-group' buttonStyle='btn--outline' buttonSize='btn--large'>
          Create New Chat Group
        </Button>
      </Link>
      {/* Diğer chat grupları listeleme ve içerikleri */}
    </div>
    )

}
